SELECT COUNT(*) as agg_0, MIN("client"."client_id" + "dobito"."client_id") as agg_1 FROM "probehnuto" LEFT OUTER JOIN "client" ON "probehnuto"."client_id" = "client"."client_id" LEFT OUTER JOIN "dobito" ON "client"."client_id" = "dobito"."client_id"  WHERE "client"."kraj" NOT LIKE '%Zl%ínský%' AND "dobito"."sluzba" IN ('c', 'h') AND ("client"."obor" LIKE '%Al%ice%' OR "client"."obor" NOT LIKE '%Richard%' OR "client"."obor" IN ('Anezka', 'Vladan')) AND "probehnuto"."sluzba" = 'e' AND "client"."kraj" IN ('Olomoucký kraj', 'Středočeský kraj', 'Jihočeský kraj', 'Královéhradecký kraj', 'Moravskoslezský kraj', 'Praha', 'Plzeňský kraj', 'Ústecký kraj')